import React from "react";
import { Route , Routes } from "react-router-dom";

import About from "./pages/About/About";

const Routing = () => {
    return (  // Dodajemy return, aby funkcja zwracała JSX
        <Routes>
        <Route path="/" element={<About />} />
        </Routes>
    );
}

export default Routing;
